import getLocationHierarchy from "./getLocationHierarchy"
import renderIndexMenu from './renderIndexMenu';
import ListItem from "./listItem"

export default function ItemList(props) {
  let type = props.data['display'][props.profile] 
  let item_profiles = props.item[props.profile]
  let container = []

  if (!type['highlighted'] && !props.data['display']['nonehighlighted']) {
    return <div></div>
  }

  for (let i = 0; i < props.pageNumber; i++) {
    if (!item_profiles[i]) break
    container.push(item_profiles[i])
  }

  const getLink = (item) => {
    if (!props.link) return ""
    else return getLocationHierarchy(item[0].data, props.profile)
  }

  const renderList = () => {
    return container.map((item, i) => (
      <a
        target="blank" 
        href={getLink(item)}
        style={{textDecoration: "none", color: "inherit"}}
        onMouseEnter={(e) => e.target.style.borderColor = "#07405b"}
        onMouseLeave={(e => e.target.style.borderColor = "#4382BC")}
        >
        <ListItem 
          key={`${props.profile}${i}D`} 
          item1={item[0].data} 
          item2={item[1].data} 
          item3={item[2].data} 
          item4={item[3].data} 
          item5={item[4].data} 
          item6={item[5].data}
        />
      </a>
    ))
  }

  if (type) {
    return (
      <div>
        {renderIndexMenu(props.data, props.item, props.filteredSearch, props.profile)}
        {renderList()}
      </div>
    )
  }
}
